import './ExpenseItem.css';

const ExpenseItem=()=>{
    return (
        <div className='expense-item '>
             <div>March 2nd 2001</div>
             <div>
                <h2>Hospital</h2>
                <div>$1000</div>
             </div>
        </div>
    )
}

export default ExpenseItem;
